import React from 'react';
import { connect } from 'react-redux'
import {loadToDoList} from '../action/index'


function Hello (props){

  
  //   if (this.props.loading) {
  //     return <div>Loading</div>
  //  }
  //   if (this.props.error){
  //   return<div style={{color:'red'}}><center>Error:{this.props.error}</center></div>
  //   }
  return (
      <div>
      <center>
      <ul>   
            {props.toDoList.map(u => (
          <li>Name:{u.myprofile.Name}<br></br>Age:{u.myprofile.Age}<br></br>Email:{u.myprofile.Email}</li>
        ))}
      </ul>
      </center>
      </div>
  );

}

const mapStateToProps = (state) => {
  
 return{ toDoList: state.toDoList}
  //   loading: state.loading,
  //  error: state.error,
  
};
const mapDispatchToProps = (dispatch) =>{
  return{loadToDoList: () => dispatch (loadToDoList())}
};
export default connect (mapStateToProps,mapDispatchToProps)(Hello);
